    <template v-if="getBettingtable === 'dragontiger'">
      <!-- Betting Area -->
      <ul class="betting__area --is-dragontiger">
        <li v-for="(betSection, sectionIndex) in betTable.section" @click="addChips(sectionIndex)" :class="'--is-' + sectionIndex" :key="sectionIndex">
          <div class="table__bet">
            <span class="bet-ratio --is-number"> {{ betSection.ratio }} </span>
            <img style="position:absolute; height:40px; width:40px"
                 v-for="(stacking_bet, stackIndex) in betSection.bets"
                 v-if="stackIndex < 5"
                 :class="stackIndex < 5 ? '_'+ (stackIndex+1) : '_'+5"
                 :src="'static/chips/betting/'+stacking_bet.chipImage+'.png'" :key="stackIndex">

            <label class="label__bet --is-number" v-if="betSection.sumOfStagedChips">
              <animated-number :duration="200" :value="betSection.sumOfStagedChips" :formatValue="formatToPrice"/>
            </label>

            <template v-if="betSection.hasPercentage">
              <v-progress-circular :rotate="-90" :value="betSection.percentage" :size="38" color="green">
              {{ betSection.percentage || 0 }}%
              </v-progress-circular>
              <div class="ut__wrap" >
                <div class="no_of_user">
                  <div class="svg-holder">
